import Jumbotron from './components/Jumbotron';
import imageThumbnail from './components/image-thumbnail';

const imgCast =["../../public/images/arya.jpeg"]


function App() {
  return (
<div>
  <Jumbotron />
  <div className="container">
    <div className="row">
      <div className="col">
      <img src={imgCast[0]} alt="..." className="img-thumbnail"></img>

      </div>
    </div>
  </div>
</div>
  );
}

export default App;
